import{_ as e,c as a,o as n,a as o}from"./app.4cda323f.js";const m='{"title":"FAQ","description":"","frontmatter":{},"headers":[{"level":2,"title":"FAQ","slug":"faq"}],"relativePath":"faq.md","lastUpdated":1651384657518}',r={},t=o('<h2 id="faq" tabindex="-1">FAQ <a class="header-anchor" href="#faq" aria-hidden="true">#</a></h2><h4 id="do-i-need-to-buy-any-google-subscription-for-teamone" tabindex="-1">Do I need to buy any Google subscription for TeamOne? <a class="header-anchor" href="#do-i-need-to-buy-any-google-subscription-for-teamone" aria-hidden="true">#</a></h4><p>No. Even a free gmail account would work for individual licenses. Though if you purchase a Google Workspace plan, you will be able to install TeamOne for all your users.</p><h4 id="does-any-server-side-software-need-to-be-installed" tabindex="-1">Does any server side software need to be installed? <a class="header-anchor" href="#does-any-server-side-software-need-to-be-installed" aria-hidden="true">#</a></h4><p>No. TeamOne lives in Google Cloud and does not require anything to be installed on TM1 server or you computer.</p><h4 id="will-any-of-my-data-be-sent-or-stored-on-any-3rd-party-servers" tabindex="-1">Will any of my data be sent or stored on any 3rd party servers? <a class="header-anchor" href="#will-any-of-my-data-be-sent-or-stored-on-any-3rd-party-servers" aria-hidden="true">#</a></h4><p>TeamOne connects directly from your browser to IBM Planning Analytics / TM1 server. No data is being sent or stored on any other servers.</p><h4 id="can-teamone-connect-to-ibm-planning-analytics-cloud" tabindex="-1">Can TeamOne connect to IBM Planning Analytics Cloud <a class="header-anchor" href="#can-teamone-connect-to-ibm-planning-analytics-cloud" aria-hidden="true">#</a></h4><p>Yes, TeamOne can connect to PA cloud using a non-interactive user account (that you receive in your IBM PA Cloud welcome kit). More non-interactive user accounts can be created with different permissions so they can be used by different user groups accordingly.</p><h4 id="what-tm1-ibm-planning-analytics-version-is-supported" tabindex="-1">What TM1 \\ IBM Planning Analytics version is supported <a class="header-anchor" href="#what-tm1-ibm-planning-analytics-version-is-supported" aria-hidden="true">#</a></h4><p>Even though some functionality may work in the older versions, TeamOne add-on officially supports version IBM Planning Analytics 2.0.5 or newer.</p><h4 id="which-tm1-integratedsecuritymode-does-teamone-support" tabindex="-1">Which TM1 IntegratedSecurityMode does TeamOne support? <a class="header-anchor" href="#which-tm1-integratedsecuritymode-does-teamone-support" aria-hidden="true">#</a></h4><p>TeamOne supports the next TM1 integrated security modes: 1, 4, 5. If you don&#39;t specify <strong>-namespace</strong> property of your environment definition, it will use mode 1 for connecting to TM1.</p><hr><p>Succeedium\xAE TeamOne 2022 | <a href="https://succeedium.com/teamone/privacy" target="_blank" rel="noopener noreferrer">Privacy Policy</a> | <a href="https://succeedium.com/teamone/terms" target="_blank" rel="noopener noreferrer">Terms Of Service</a></p>',15),i=[t];function s(d,c,l,h,u,p){return n(),a("div",null,i)}var f=e(r,[["render",s]]);export{m as __pageData,f as default};
